const Filter = () => (
  <ContainerFilter>
    <ContainerPrice>
      <TitlePrice>Pre√ßos</TitlePrice>
      <ContainerCheckbox>
        <input type="checkbox" id="horns" name="horns" />
        <label htmlFor="horns">R$10 </label>
        <label htmlFor="horns">R$10-$100</label>
        <label htmlFor="horns">R$100-$500</label>
        <label htmlFor="horns">R$500</label>
      </ContainerCheckbox>
    </ContainerPrice>
  </ContainerFilter>
);

export default Filter;
